"use strict";(self.webpackChunkfood_blog=self.webpackChunkfood_blog||[]).push([[518],{4369:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"andys","metadata":{"permalink":"/andys","source":"@site/blog/2024-10-01-andys/index.md","title":"Andy\'s Lunchroom","description":"Vandaag gingen we naar Andy\'s lunchroom. Een snacktent naast station Alkmaar Noord, en bekend om hun beste **hotdogs van Europa!**","date":"2024-10-01T00:00:00.000Z","tags":[],"readingTime":0.695,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"andys","title":"Andy\'s Lunchroom","authors":["jordykuhne"],"comments":true},"unlisted":false,"nextItem":{"title":"Hiennies","permalink":"/hiennies"}},"content":"Vandaag gingen we naar [Andy\'s lunchroom](https://www.andyslunchroom.nl/). Een snacktent naast station Alkmaar Noord, en bekend om hun beste _**hotdogs van Europa!**_\\n\\n![andys lunchroom](andys-cafetaria-19080812574663.jpg)\\n\\n\x3c!-- truncate --\x3e\\n\\nIk had de *Chicago Dog* en een warme chocomelk. De hotdog was heerlijk, en de chocomelk was lekker warm. De rest had ook allemaal hotdogs, en iedereen was zeer tevreden met het eten.\\n\\nHet personeel kan wel wat vriendelijker. Ik werd verbaal aangevallen door een van de medewerkers en was diep geschokt.\\n\\n![alt text](hotdogs.png)\\n\\nDus in conclusie: Personeel kan beter, maar hun hotdogs zijn inderdaad de beste van heel europa.\\n\\n## Cijfers\\n\\n| Persoon  | Cijfer |\\n|----------|--------|\\n| Madelief | 8,5    |\\n| Marthijn | 8,3    |\\n| Desiree  | 8,4    |\\n| Bas      | 8,4    |\\n| Jordy    | 1,0    |\\n|**Totaal**|**6,1** |\\n\\n## Locatie\\n\\n<iframe src=\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2415.013394132842!2d4.760620061046338!3d52.643738891529686!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47cf56515f56bf93%3A0xfa19c20dc6e7dfa2!2sAndy&#39;s%20Cafetaria!5e0!3m2!1snl!2snl!4v1727825716971!5m2!1snl!2snl\\" width=\\"600\\" height=\\"450\\" allowfullscreen=\\"\\" loading=\\"lazy\\" referrerpolicy=\\"no-referrer-when-downgrade\\"></iframe>"},{"id":"hiennies","metadata":{"permalink":"/hiennies","source":"@site/blog/2024-09-24-hiennies/index.md","title":"Hiennies","description":"Vandaag gingen we naar Hiennies. Een streetfood tent in Heerhugowaard. Volgens vele hebben ze het **beste streetfood van Europa!**","date":"2024-09-24T00:00:00.000Z","tags":[],"readingTime":0.65,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"hiennies","title":"Hiennies","authors":["jordykuhne"],"comments":true},"unlisted":false,"prevItem":{"title":"Andy\'s Lunchroom","permalink":"/andys"},"nextItem":{"title":"Jacky","permalink":"/jacky"}},"content":"Vandaag gingen we naar [Hiennies](https://hiennies.sitedish.shop/). Een streetfood tent in Heerhugowaard. Volgens vele hebben ze het _**beste streetfood van Europa!**_\\n\\n![alt text](image.png)\\n\\n\\n\x3c!-- truncate --\x3e\\n\\nZe hebben een groot menu met niet alleen streetfood, maar ook snackbar gerechten. Zelf had ik een broodje hete kip met een kaassouffl\xe9. De hete kip was best lekker, maar net iets te pittig voor mij. De kaassouffl\xe9 was _very nice_.\\n\\n![alt text](d82fe2c98608068504bf36bea0bf-1.jpg)\\n\\nHet personeel was vriendelijk, maar het duurde wel effe voordat we ons eten kregen. Maar misschien voelt het alleen maar zo omdat we staand in de kou moesten wachten.\\n\\n## Cijfers\\n\\n| Persoon  | Cijfer |\\n|----------|--------|\\n| Marthijn | 8,7    |\\n| Bas      | 6,9    |\\n| Jordy    | 10     |\\n|**Totaal**|**8,5** |\\n\\n## Locatie\\n\\n<iframe src=\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2419.8720095748195!2d4.82603599363711!3d52.662289353750715!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47cf543b90877ae3%3A0xd7088eb721d02d5b!2sStreetfood%20By%20Hiennies%20%26%20Bubble%20Tea!5e0!3m2!1snl!2snl!4v1727829332715!5m2!1snl!2snl\\" width=\\"600\\" height=\\"450\\" allowfullscreen=\\"\\" loading=\\"lazy\\" referrerpolicy=\\"no-referrer-when-downgrade\\"></iframe>"},{"id":"jacky","metadata":{"permalink":"/jacky","source":"@site/blog/2024-09-17-jacky/index.md","title":"Jacky","description":"Deze week zijn we naar Jacky geweest. Een mooi restaurantje in Alkmaar, waar ze toevalig ook de **beste burgers van Europa hebben!**","date":"2024-09-17T00:00:00.000Z","tags":[],"readingTime":0.73,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"jacky","title":"Jacky","authors":["jordykuhne"],"comments":true},"unlisted":false,"prevItem":{"title":"Hiennies","permalink":"/hiennies"},"nextItem":{"title":"Roberto","permalink":"/roberto"}},"content":"Deze week zijn we naar [Jacky](https://jackyalkmaar.nl/) geweest. Een mooi restaurantje in Alkmaar, waar ze toevalig ook de _**beste burgers van Europa hebben!**_\\n\\n![jacky logo](jacky-alkmaar.jpg)\\n\\n\x3c!-- truncate --\x3e\\n\\nWe hadden alle drie de beroemde Smash Burger besteld.\\nEen heerlijke burger, gesmasht, met cheddar, bacon, sla, tomaat en ui met wat frietjes erbij.\\n\\n![smash burger](images.jpg)\\n\\nMarthijn was helaas een beetje ziek, waardoor we zijn cijfer niet serieus konde nemen. En hij kreeg het ook niet op, dus ik had wel lekker een ander halve burger op. :)\\n\\nHet personeel was ook erg vriendelijk en het eten kwam snel. Voor een snelle lunch in je pauze is dit een mooie plek.\\n\\n![jacky buitenkant](Jacky-Alkmaar-vooraanzicht.jpeg)\\n\\n## Cijfers\\n\\n| Persoon  | Cijfer |\\n|----------|--------|\\n| Marthijn | Ziek, telt niet |\\n| Bas      | 7,1    |\\n| Jordy    | 10     |\\n|**Totaal**|**8,6** |\\n\\n## Locatie\\n\\n<iframe src=\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2421.3383812753236!2d4.749031777021208!3d52.6357993276492!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47cf5766bfacba05%3A0x912d806b6f1cf8bf!2sJacky%20Alkmaar!5e0!3m2!1snl!2snl!4v1727828594341!5m2!1snl!2snl\\" width=\\"600\\" height=\\"450\\" allowfullscreen=\\"\\" loading=\\"lazy\\" referrerpolicy=\\"no-referrer-when-downgrade\\"></iframe>"},{"id":"roberto","metadata":{"permalink":"/roberto","source":"@site/blog/2024-08-30-roberto/index.md","title":"Roberto","description":"Voor de eerste tent van Tour de la Schrans gingen we naar Restaurant Roberto. Een Italiaans restaurant in Alkmaar, en bekend om hun beste **pizza van Europa!**","date":"2024-08-30T00:00:00.000Z","tags":[],"readingTime":0.83,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"roberto","title":"Roberto","authors":["jordykuhne"],"comments":true},"unlisted":false,"prevItem":{"title":"Jacky","permalink":"/jacky"},"nextItem":{"title":"Welkom","permalink":"/welkom"}},"content":"Voor de eerste tent van _Tour de la Schrans_ gingen we naar [Restaurant Roberto](https://roberto-alkmaar.nl/). Een Italiaans restaurant in Alkmaar, en bekend om hun beste _**pizza van Europa!**_\\n\\n![Roberto](./pand.jpg)\\n\\n\x3c!-- truncate --\x3e\\n\\nWe hadden meerdere gerechten besteld en gedeeld. We begonnen met de Bruschetta, wat een heerlijke starter was. Daarna had ik een Pizza margherita, wat een lekkere steenoven pizza was. En daarnaast had ik wat frietjes en salade gepakt van de tafel.\\n\\nZe hadden ook een stoofpeer walnoten pizza. Volgens Marthijn is die heerlijk, maar het leek ons allemaal zo smerig dat we het niet hebben geprobeerd. \\n\\n![Meneer Roberto](roberto-alkmaar.jpeg)\\n\\nAl in al was het heerlijk eten, en vriendelijk personeel. We hebben zelfs de man hemzelf, Roberto, gezien maar ik durfde helaas niet om een foto te vragen.\\n\\n## Cijfers\\n\\n| Persoon  | Cijfer |\\n|----------|--------|\\n| Marthijn | 8,3    |\\n| Bas      | 9,1    |\\n| Madelief | 7,0    |\\n| Jordy    | 10     |\\n|**Totaal**|**8,9** |\\n\\n## Locatie\\n\\n<iframe src=\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2422.0190350890566!2d4.734338977020612!3d52.623500128561105!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47cf572c564c2bdb%3A0xe19e91f2fbae5e43!2sRoberto%20bar%20e%20cucina!5e0!3m2!1snl!2snl!4v1727826688913!5m2!1snl!2snl\\" width=\\"600\\" height=\\"450\\" allowfullscreen=\\"\\" loading=\\"lazy\\" referrerpolicy=\\"no-referrer-when-downgrade\\"></iframe>"},{"id":"welkom","metadata":{"permalink":"/welkom","source":"@site/blog/2024-08-28-welkom/index.md","title":"Welkom","description":"Tour de la Schrans, een gepassioneerd concept bedacht door een paar dikke gasten","date":"2024-08-28T00:00:00.000Z","tags":[],"readingTime":0.29,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"welkom","title":"Welkom","authors":["jordykuhne"],"comments":true},"unlisted":false,"prevItem":{"title":"Roberto","permalink":"/roberto"}},"content":"## _Tour de la Schrans_, een gepassioneerd concept bedacht door een paar dikke gasten\\n\\nWelkom bij _Tour de la Schrans_! \x3c!-- truncate --\x3e\\nElke dinsdag gaan we lunchen bij een nieuwe tent in of rondom Alkmaar, en delen we onze ervaringen hier.\\n\\nWe zijn nog op zoek naar een sponsor want dit kost veels te veel geld.\\n\\n\\n![Hotdogs](./hotdogs.png)"}]}}')}}]);